      text-transform: uppercase;
    }

    input:focus + label,
    input:not(:placeholder-shown) + label {
      transform: translateY(-50px) scale(0.8);
      opacity: 0.8;
      left: 0;
    }
  }

  textarea {
    width: 100%;
    height: 130px;
    background: #E1F9ED;
    border: 2px solid color(lightgreen);
    border-radius: 8px;
    padding: 12px 0 0 12px;
