  &__button {
    position: relative;
    padding: 19px 30px;
    transition: all .2s ease;
    text-decoration: none;
    color: inherit;
    margin: 30px auto 0 0;
    cursor: pointer;

    @media (min-width: 1200px) {
      &:before {
        content: "";
        position: absolute;
        top: 0;
        left: 0;
        display: block;
        border-radius: 28px;
        background: color(lightgreen);
        width: 56px;
        height: 56px;
        transition: all .3s ease;
      }
  
      &:hover {
        &:before {
          width: 100%;
          background: color(lightgreen); 
        }
        svg {
          transform: translateX(0);
        }
      }
      
      &:active {
        transform: scale(.96);
      }
    }

    @media (max-width: 1200px) {
      background: color(lightgreen);
      border-radius: 28px;
    }

    span {
      position: relative;
      font-size: 16px;
      line-height: 18px;
