      color: color(dark);
    }
  
    svg {
      position: relative;
      top: 1px;
      margin-left: 10px;
      fill: none;
      stroke-linecap: round;
      stroke-linejoin: round;
      stroke: color(dark);
      stroke-width: 2;
      transform: translateX(-5px);
      transition: all .3s ease;
    }
  }

  &__label-checkbox {
    --background: #fff;
    --background: #fff;
    --border: #D1D6EE;
    --border-hover: #BBC1E1;
    --border-active: #15BD6D;
    --tick: #fff;
    position: relative;
    display: flex;
    align-items: flex-start;

    p {
      font-weight: 400;
      font-size: 14px;
      line-height: 135%;      
      letter-spacing: 0.025em;
      color: #5A5A5A;
      margin: 2px 0 0 6px;
      -webkit-touch-callout: none;
      -webkit-user-select: none; 
      -khtml-user-select: none; 
      -moz-user-select: none;
      -ms-user-select: none;
      user-select: none;
    }

    a {
      position: relative;
      color: color(green);

      &:after {
        content: '';
        position: absolute;
        left: 0;
        bottom: -5px;
        height: 1px;
        width: 100%;
        background-color: color(green);
      }
    }

    input,
    svg {
      width: 21px;
      height: 21px;
      display: block;
    }

    input {
      -webkit-appearance: none;
      -moz-appearance: none;
      position: relative;
      outline: none;
      background: var(--background);
      border: none;
      margin: 0;
      padding: 0;
      cursor: pointer;
      border-radius: 4px;
      transition: box-shadow .3s;
      box-shadow: inset 0 0 0 var(--s, 1px) var(--b, var(--border));
      &:hover {
        --s: 2px;
        --b: var(--border-hover);
      }
      &:checked {
        --b: var(--border-active);
      }
    }

    svg {
      pointer-events: none;
      fill: none;
      stroke-width: 2px;
      stroke-linecap: round;
      stroke-linejoin: round;
      stroke: var(--stroke, var(--border-active));
      position: absolute;
      top: 0;
      left: 0;
      width: 21px;
      height: 21px;
      transform: scale(var(--scale, 1)) translateZ(0);
    }

    &.path {
      input {
        &:checked {
          --s: 2px;
