.banner__cleaning {
  margin: 200px auto 130px;
  @include ipadProScreen {
    margin-top: 130px;
  }

  @include ipadScreen {
    margin-top: 110px;   
  }

  &__items {
    display: flex;
    align-items: center;
    margin-bottom: 80px;

    @media (max-width: 1200px) {
      flex-direction: column;
    }
  }

  &__info {
    width: 48%;
    h1 {
      font-style: normal;
      font-weight: 400;
      font-size: 60px;
      line-height: 70px;
      letter-spacing: 0.02em;
      margin-bottom: 12px;
      color: color(green);
      @media (max-width: 1260px) {
        font-size: 50px;
      }

      @include phoneScreen {
        font-size: 35px !important; 
        line-height: 32px;
      }
    }

    p {
      font-weight: 400;
      font-size: 16px;
      line-height: 180%;
      letter-spacing: 0.025em;
      max-width: 510px;
      margin-bottom: 50px;
      color: color(dark);
    }

    @media (max-width: 1200px) {
      order: 1;
      width: 100%;
      padding: 50px 0;
    }

    @include phoneScreen {
      padding: 30px 0;
    }
  }
 
  &__banner__cleaning {
    @media (max-width: 1200px) {
      order: 0;
      width: 100%;
    }
  }


  &__button {
    position: relative;
    padding: 19px 30px;
    transition: all .2s ease;
    text-decoration: none;
    color: inherit;
    margin: 100px auto; 
    @media (min-width: 1200px) {
      &:before {
        content: "";
        position: absolute;
        top: 0;
        left: 0;
        display: block;
        border-radius: 28px;
        background: color(lightgreen);
        width: 56px;
        height: 56px;
        transition: all .3s ease;
      }
  
      &:hover {
        &:before {
          width: 100%;
          background: color(lightgreen); 
        }
        svg {
          transform: translateX(0);
        }
      }
      &:active {
        transform: scale(.96);
      }
    }

    @media (max-width: 1200px) {
      width: 100%;
      background: color(lightgreen);
      border-radius: 28px;
    }
  }
  
  span {
    position: relative;
    font-size: 16px;
    line-height: 18px;
    font-weight: 500;
    vertical-align: middle;
    color: color(dark);
  }

  svg {
    position: relative;
    top: 1px;
    margin-left: 10px;
    fill: none;
    stroke-linecap: round;
    stroke-linejoin: round;
    stroke: color(dark);
    stroke-width: 2;
    transform: translateX(-5px);
    transition: all .3s ease;
  }

  &__services__items {
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
    gap: 40px;
  }

  &__services__item {
    overflow: hidden;
    background: #77B093;
    &:hover {
      img {
        transform: scale(1.1);
      }
    }
  }

  &__services__item-images {
    position: relative;
    overflow: hidden;
    img {
      transition: all 0.3s;
    }
  }

  &__services__item-info {
    padding: 20px 18px;
    padding: 20px 18px;
    display: flex;
    align-items: center;
    flex-direction: column;
    gap: 10px;
    p {
      font-weight: 400;
      font-size: 14px;
      letter-spacing: 0.02em;
      max-width: 100%;
      margin: auto;
      color: color(white);
    }

    a {
      transition: all 0.3s;
      margin: auto;
      &:hover {
        background-color: color(white);
        color: #77B093;
      }
    }
  }
}

